        })
    }

    render() {
        return (
            <>
                <figure>
                    <img src={'/static/bag-icon.png'} style={{ backgroundColor: "black" }}></img>
                </figure>
                <small>Cart</small>
                <small>{this.props.info.length}</small>

                <div>
                    <p>SubTotal{this.props.info.reduce((acc, cv) => {
                        acc = acc + cv.price
                        return acc;
                    }, 0)}</p>
                </div>

                {
                    this.props.info.map((a) => {
                        return (
                            <>
                                <p>{a.title}</p>
                                <p>{a.style}</p>
                                <p>{a.price}</p>

                                <p>{a.currencyId}</p>


                            </>
                        )
                    })

                }







            </>
        )
    }

}

export default Cart
